import React from 'react';
import Entry from "./Entry";

const Entries = ({entries}) => {
    const entryMap = entries.map(entry => <Entry key={entry.id} {...entry} />)

    return (
        <div>
            {entryMap}
        </div>
    );

};

export default Entries;
